function areWeightsIdentical(weightsa, weightsb, tol) {
	//
	if (weightsa.length != weightsb.length) {
		return false;
	}
	
	//
	for (var i = 0; i < weightsa.length; ++i) {
		if (Math.abs(weightsa[i] - weightsb[i]) > tol) {
			return false;
		}
	}
	
	//
	return true;
}

