		assert.throws(function() { 
		PortfolioAllocation.meanVarianceOptimizationWeights(returns, covMat) },
			new Error('missing return, volatility or risk tolerance constraints'),
			"Mean variance portfolio - Missing mean-variance optimization method");

		assert.throws(function() { 
		PortfolioAllocation.meanVarianceOptimizationWeights(returns, covMat, { constraints: {return: 0.10, volatility: 0.1}}) },
			new Error('simultaneous return and volatility constraints'),
			"Mean variance portfolio - Simultaneous exclusive constraints");
			
		assert.throws(function() { 
		PortfolioAllocation.meanVarianceOptimizationWeights(returns, covMat, { constraints: {riskTolerance: 4.18, volatility: 0.1}}) },
			new Error('simultaneous risk tolerance and return or volatility constraints'),
			"Mean variance portfolio - Simultaneous exclusive constraints #2");
			
